import React, {Component} from 'react';

const WorkoutList = (props) => {

    const workouts = props.workouts.map((workout)=> {
        return(
            <li key={workout._id}>
                <h2>{workout.name}</h2>
                <p>{workout.intervalOne}</p>
                <p>{workout.intervalTwo}</p>
                <p>{workout.cycles}</p>
            </li>
        )
    });

    return(
        <div>
            <ul>
                {workouts}
            </ul>
        </div>

    )
}




export default WorkoutList;
